import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  const expenses = props.expenses

  return (
    <div className="expenses">
      {expenses.map((objectMy) => (
        <ExpenseItem
          key={objectMy.id}
          title={objectMy.title}
          amount={objectMy.amount}
          date={objectMy.date}
        />
      ))};
    </div>
  );
}

export default Expenses;
